import React from "react";
import {STLViewer} from 'react-stl-obj-viewer';


function STLDisplay(props){
return(
	<STLViewer
	onSceneRendered={(element) => {
		console.log(element)
	}}
	width={600}
	height={420}
	sceneClassName="test-scene"
	file={props.file}
	className="stl"
	modelColor="#F1F1F1F1"
	backgroundColor='#FFFFFF'
	/> 

)
};

export default STLDisplay;
